import React from "react";
import {Link} from "react-router-dom";
import logo from "../bryandelossantos.png";


function Home() {
    return(
        <div className = "Homebg">
        <main>
        <img src={logo} className="App-logo" alt="logo" />
        <h1>
          My Name is Bryan De Los Santos!
        </h1>
         
        </main>

        </div>
        );
}

export default Home
